import React from "react";
import withSearch from "./WithSearch";
import { data } from "./Data";

const Services = ({ selectedItem }) => {
  return (
    <div>
      <h2>Services Component</h2>
      <p>Selected Item: {selectedItem}</p>
    </div>
  );
};

export default withSearch(Services, data);
